function onColumnHeaderClicked( ev ) {

    const th = ev.currentTarget;
    const table = th.closest( 'table' );
    const thIndex = Array.from( th.parentElement.children ).indexOf( th );

    const ascending = !( 'sort' in th.dataset ) || th.dataset.sort != 'asc';
    
    const start = performance.now();

    sortTableRowsByColumn( table, thIndex, ascending );

    const end = performance.now();
    console.log( "Sorted table rows in %d ms.",  end - start );

    const allTh = table.querySelectorAll( 'thead > tr > th' );
    for( let th2 of allTh ) {
        delete th2.dataset['sort'];
    }
 
    th.dataset['sort'] = ascending ? 'asc' : 'desc';
	
}

function sortTableRowsByColumn( table, columnIndex, ascending ) {

    for (var i=0; i<tableHeader.rows[0].cells.length; i++) {
		if (i==columnIndex) {
            tableHeader.rows[0].cells[i].style.color = "#fff";
			if (ascending) {
				tableHeader.rows[0].cells[i].style.textDecoration = "underline";
			} else {
				tableHeader.rows[0].cells[i].style.textDecoration = "overline";
			}
		} else {
            tableHeader.rows[0].cells[i].style.color = "#999";
			tableHeader.rows[0].cells[i].style.textDecoration = "none";
		}
    }

    const rows = Array.from( table.querySelectorAll( 'tbody > tr' ) );

	rows.sort( ( x, y ) => {
        const xValue = x.cells[columnIndex].textContent;
        const yValue = y.cells[columnIndex].textContent;
		
		if (columnIndex > 3) {  
			const xNum = parseFloat( xValue );
			const yNum = parseFloat( yValue );
			return ascending ? ( xNum - yNum ) : ( yNum - xNum );
		} else {  
			if (xValue > yValue) {
				return ascending ? 1 : -1;
			} else if (xValue == yValue) {
				return 0;
			} else {
				return ascending ? -1 : 1;
			}
		}
    } );

    for( let row of rows ) {
        table.tBodies[0].appendChild( row );
    }
}

                for (var i=0; i<tableAll.rows[row].cells.length; i++) {
